def day1part1(key: str) -> int:
    ascend = key.count("(")
    descend = key.count(")") * - 1
    return ascend + descend


def day1part2(key: str) -> int:
    floor = 0
    for index, elm in enumerate(key):
        if elm == "(":
            floor += 1
        else:
            floor -= 1

        if floor == -1:
            return index + 1


print(day1part1(key))
print(day1part2(key))
